export const loginUserAction = (data) => ({
    type: 'USER_LOGIN',
    payload: data,
  });

export const loginUserSuccess = (data) => ({
  type: 'LOGIN_SUCCESS',
  payload: data,
});

export const loginUserFailed = (data) => ({
  type: 'LOGIN_FAILED',
  payload: data,
});

export const signUpUserAction = (data) => ({
  type: 'USER_SIGN_UP',
  payload: data,
});
